import React from 'react-dom'

function Navbar(){
  return (
       <div className='navbar_container'>
           <div className='cnav'>
               <div className='cnav-c1'>
                  <div className='chlogo'> Carigaar </div>
               </div>

               <div className='cnav-c2'>
                  <div> Information </div>
               </div>
            </div>
        </div>
     )}

export default Navbar;
